void Sound_Init(void){ uint32_t volatile delay;
	SYSCTL_RCGCGPIO_R |= 0x02;
	delay = SYSCTL_RCGCGPIO_R;
	GPIO_PORTB_DIR_R |= 0x3F; // bits 5-0 output
	GPIO_PORTB_AFSEL_R &= ~0x3F;
	GPIO_PORTB_DEN_R |= 0x3F;
	SysTick_Init(7256);
};

void Sound_Play(){
	if(SoundEnabled){
		GPIO_PORTB_DATA_R = SoundSelection[SoundCount];
		SoundCount++;
		if(SoundCount>SoundCountMax){SoundEnabled = 0;}}
};

void Sound_Bomb(void){
	SoundSelection = Bomb;
	SoundCountMax = BombMax;
	SoundCount = 0;
	SoundEnabled = 1;};

